public class Input4 : AbstractInput<(IReadOnlyDictionary<Tuple<int, int>, char>, int, int), (IReadOnlyDictionary<Tuple<int, int>, char>, int, int)>
{
  protected override (IReadOnlyDictionary<Tuple<int, int>, char>, int, int) FormatFirst(string input)
  {
    var rows = input.Split('\n');
    var x = rows[0].Length;
    var y = rows.Length;
    var chart = new Dictionary<Tuple<int, int>, char>(x * y);

    for (var i = 0; i < y; i++)
    {
      for (var j = 0; j < x; j++)
      {
        chart.Add((j, i).ToTuple(), rows[i][j]);
      }
    }

    return (chart, x, y);
  }

  protected override (IReadOnlyDictionary<Tuple<int, int>, char>, int, int) FormatSecond(string input) => FormatFirst(input);

